tables.table_schema:
CREATE TABLE docking_results (
    experiment_id INT PRIMARY KEY,
    ligand_name VARCHAR(255),
    receptor_name VARCHAR(255),
    docked_score FLOAT
);

CREATE TABLE ligands (
    ligand_id INT PRIMARY KEY,
    smiles_code TEXT,
    molecular_weight FLOAT,
    pubchem_id INT
);

CREATE TABLE receptors (
    receptor_id INT PRIMARY KEY,
    protein_name VARCHAR(255),
    resolution FLOAT,
    pdb_id VARCHAR(10)
);

CREATE TABLE docking_results (
	result_id SERIAL PRIMARY KEY,
	ligand_id INTEGER,
	protein_id INTEGER,
	score FLOAT
);

CREATE TABLE ligands (
	ligand_id SERIAL PRIMARY KEY,
	ligand_name VARCHAR(255),
	smiles_code TEXT
);

CREATE TABLE proteins (
	protein_id SERIAL PRIMARY KEY,
	protein_name VARCHAR(255),
	protein_sequence TEXT
);

CREATE TABLE docking_logs (
    log_id INT PRIMARY KEY,
    docking_id INT,
    log_info TEXT,
    log_date TIMESTAMP
);

CREATE TABLE docking_parameters (
    parameter_id INT PRIMARY KEY,
    docking_id INT,
    parameter_name VARCHAR(255),
    parameter_value TEXT
);

CREATE TABLE docking_proteins (
    protein_id INT PRIMARY KEY,
    docking_id INT,
    protein_name VARCHAR(255),
    protein_sequence TEXT
);

CREATE TABLE docking_ligands (
    ligand_id INT PRIMARY KEY,
    docking_id INT,
    ligand_structure BLOB,
    ligand_smiles TEXT
);
